import React from 'react';
import './header.css';
import logo from '../../UserPanel/img/Logo.svg';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header class="adminheader">
    <nav>
         <li>
           <Link to="/Admin"><img src={logo} alt="logo"/></Link>
         </li>

        <ul>
            <li><><i class="fas fa-solid fa-house"></i>Home</></li>

        </ul>

        <ul>
            <li><Link to='/addproduct'><i
                    class="fas fa-brands fa-product-hunt"></i>Add Products</Link></li>
        </ul>
    </nav>
</header>

  );
}

export default Header;
